import React from 'react';

import styles from './RequestForm.module.css';
import Container from '../../../hoc/Container/Container';

const requestForm = props => {
    return (
        <div className={styles.RequestForm}>
            <Container>
                <p>{props.text}</p>
                <form method='get'>
                    <div className='Form'>
                        <input type='text' name='name' id='name' placeholder='Оставьте своё имя' required />
                    </div>
                    <div className='Form'>
                        <input type='email' name='name' id='name' placeholder="Оставьте свой номер телефона" required />
                    </div>
                    <div className='Form'>
                        <input type='submit' className={styles.Submit} />
                    </div>
                </form>
            </Container>
        </div>
    )
};

export default requestForm;
